import java.util.Calendar
import java.text.SimpleDateFormat

// get flow file
def flowFile = session.get()
if (!flowFile) return

// last day last month
def calendar = Calendar.getInstance()
calendar.add(Calendar.MONTH, -1)
calendar.set(Calendar.DAY_OF_MONTH, calendar.getActualMaximum(Calendar.DAY_OF_MONTH))

// first day last month
def calendar2 = Calendar.getInstance()
calendar2.add(Calendar.MONTH, -1)
calendar2.set(Calendar.DAY_OF_MONTH, 1)


def year = calendar.get(Calendar.YEAR);
def month = new SimpleDateFormat("MMMM").format(calendar.getTime());
def monthIso = new SimpleDateFormat("MM").format(calendar.getTime());
def fromDate = new SimpleDateFormat("yyyy-MM-dd").format(calendar2.getTime());
def toDate = new SimpleDateFormat("yyyy-MM-dd").format(calendar.getTime());

// set last month's month and year to attributes
flowFile=session.putAttribute(flowFile, "year", "$year");
flowFile=session.putAttribute(flowFile, "month", "$month");
flowFile=session.putAttribute(flowFile, "month_iso", "$monthIso");
flowFile=session.putAttribute(flowFile, "from_date", "$fromDate");
flowFile=session.putAttribute(flowFile, "to_date", "$toDate");

session.transfer(flowFile, REL_SUCCESS)

import java.util.Calendar

// get flow file
def flowFile = session.get()
if (!flowFile) return


def transmissionStart = flowFile.getAttribute("transmission_start");
def transmissionEnd = flowFile.getAttribute("transmission_end");

def transmissionStartInt = Integer.parseInt(transmissionStart);
def transmissionEndInt = Integer.parseInt(transmissionEnd);


// if in transmission window, pass as success
if (isInTransmissionWindow(transmissionStartInt, transmissionEndInt)) {
    session.transfer(flowFile, REL_SUCCESS)
} else {
    session.transfer(flowFile, REL_FAILURE)
}

// in window if date is within transmission range
def isInTransmissionWindow(transmissionStartInt, transmissionEndInt) {
    def calendar = Calendar.getInstance();
    def day = calendar.get(Calendar.DAY_OF_MONTH);

    return day >= transmissionStartInt && day <= transmissionEndInt
}

